def remove_duplicates(input_list):
    output_list = set()
    for i in input_list:
        if isinstance(i, (int, float)):
            output_list.add(int(i))
        elif isinstance(i, str):
            try:
                output_list.add(int(i))
            except ValueError:
                print(f'{i}')
                continue
    return output_list
